function getNewWord () {
    var num =  Math.floor(Math.random() * (words.length - 1)) + 1;   
    current_word.id = words[num].name.toUpperCase();
    current_word.url = "https://docs.google.com/uc?export=download&confirm=no_antivirus&id=" + words[num].id;
    current_word.shuffled = shuffle(current_word.id, 14);
    current_word.soFar = "" 
}

function update () {

    getNewWord();

    // Reset letters
    for (let i=1; i<15; i++) {
        DOM.bttns[i].value = current_word.shuffled[i-1];
    }

    // Reset screen
    DOM.img.style.visibility = "hidden";
    DOM.img.setAttribute ("src", current_word.url);
    DOM.game.style.visibility = "visible";
    DOM.word.innerHTML = "";
    DOM.word.style.background = "white";
    DOM.letters.style.display = "initial";
    for (let i=1; i<16; i++) {
        DOM.bttns[i].style.visibility = "visible";
        DOM.bttns[i].style.backgroundColor = "rgb(200, 200, 200)";
    }
  
}

function addLetter (){
    DOM.word.innerHTML += this.value;
    this.style.visibility = "hidden";
    if (DOM.word.innerHTML.trim() === current_word.id) {
        //DOM.word.style.color = "green";
        //DOM.points.style.backgroundColor = "green";
        DOM.letters.style.display = "none";
        DOM.img.style.visibility = "visible"
        DOM.img.addEventListener ("click", update);
        score.add(5);
    }
}

function shuffle(word, len) {
    while (word.length < len ) {
        word += " ";
    }
    var arr = word.split("");
    var x, i, j;
    for (i = arr.length - 1; i > 0; i--) {
        j = Math.floor(Math.random() * (i + 1));
        x = arr[i];
        arr[i] = arr[j];
        arr[j] = x;
    }
    return arr.join("");
}




update ();
